  \"2013-03-28T01:14:00.734034\",\n\t\"name\": \"state-lands-by-administrator-trails-and-waterways\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"DNR land ownership and administrative interest
  mapped to the PLS forty level. This layer merges the DNR Control Point Generated
  PLS layer with IBM mainframe-based land records. Land records in the layer depict
  lands administered by the DNR Trails and Waterways Division. The data are limited
  to a forty level resolution. Therefore, holdings that are less than a forty in extent
  are represented as a full forty in the data (although specific fields exist within
  the attribute tables that allow the user to identify these). Detailed discussion
  on the issues associated with the application of this data can be found at: http://intranet.dnr.state.mn.us/mis/gis/pdf/landrecords_read.pdf\",\n\t\"license_title\":
